-- ------------------------------------------------
-- Table structure for territory_spawnlist
-- ------------------------------------------------
DROP TABLE IF EXISTS `territory_spawnlist`;
CREATE TABLE `territory_spawnlist` (
  `castleId` INT NOT NULL default 0,
  `npcId` INT NOT NULL default 0,
  `x` INT NOT NULL default 0,
  `y` INT NOT NULL default 0,
  `z` INT NOT NULL default 0,
  `heading` INT NOT NULL default 0,
  `spawnType` INT NOT NULL default 0, -- 0-spawned when castle have owner, 1-spawns in TW time
  KEY `id` (`castleId`)
) ENGINE = MYISAM DEFAULT CHARSET=utf8;

